function TodoMemoDivRender({input}){
    if(input.length !==0){

    var temp = input[0];
    console.log(temp);
    return(
        <div className="todoMainElement" key={temp.todolist}>{temp.todolist}</div>
    );

    }

};

export default TodoMemoDivRender;
